function DatabaseTable (props) {
    // const { name, columns } = props;
    const [tableData, setTableData] = React.useState(null);
    const [tableColumns, setTableColumns] = React.useState(null);

    React.useEffect(() => {
        console.log('first time');    
        const initializeTable = async () => {
            const response = await api.getTableInfo(props.name, props.columns);
            const responseAsJSON = JSON.parse(response);
            const data = responseAsJSON.data;
            // Extract keys from data and create an array of objects
            const keys = Object.keys(data[0]);

            
            const columns = keys.map(column => {
                return {
                    title: column,
                    dataIndex: column,
                    key: column,
                    render: text => <span>{text}</span>,
                };
            } );


            
            setTableColumns(columns);

            // Extract values from data and create an array of objects
            const values = Object.values(data);
            const tableData = values.map(value => {
                return {
                    key: value.id,
                    ...value
                };
            } );
    
            setTableData(tableData);
        };
        initializeTable();

    } , []);
    
    React.useEffect(() => {
        console.log('firstTime password');
        
        const renderEye = (id) => {
            const disabledEyeAsBase64Image = "data:image/png;base64,";
            const enabledEyeAsBase64Image = "data:image/png;base64,";
            const eyeElement = document.createElement('img');
            eyeElement.classList.add('eye-password-icon');
            eyeElement.id = 'eye_icon_for_' + id;
            eyeElement.src = disabledEyeAsBase64Image;
            // eyeElement.src="data:image/png;base64, iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==";
            eyeElement.onclick = () => {
                
                const password = document.getElementById(id);
                if (password.type === 'password') {
                    password.type = 'text';
                    eyeElement.src = disabledEyeAsBase64Image;
                } else {
                    password.type = 'password';
                    eyeElement.src = enabledEyeAsBase64Image;
                }
            }
            return eyeElement;
        }
        
        // Take HTML element
        const passwordHTMLElements = document.querySelectorAll('input[id^="gigya-password"]');
        // debugger;
        // Add the eye class to all the password elements
        // Add an id to all the password elements
        passwordHTMLElements.forEach((element, index) => {
            const id = element.id;
            element.id = `${element.id}`;
            element.classList.add('eye-password');
            const eyeIcon = renderEye(id);
            element.insertAdjacentElement('afterend', eyeIcon);
        } );



    } , []);


    const sampleColumns = [
    {
        title: 'Name',
        dataIndex: 'name',
        key: 'name',
        width: 100,
    },
    {
        title: 'Age',
        dataIndex: 'age',
        key: 'age',
        width: 100,
    },
    {
        title: 'Address',
        dataIndex: 'address',
        key: 'address',
        width: 200,
    },
    {
        title: 'Operations',
        dataIndex: '',
        key: 'operations',
        render: () => <a href="#">Delete</a>,
    },
    ];      
    const sampleData = [
    { name: 'Jack', age: 28, address: 'some where', key: '1' },
    { name: 'Rose', age: 36, address: 'some where', key: '2' },
    ];
    
    // Calculate needed fields for the table
    const data = tableData ? tableData : null;
    const columns = tableColumns ? tableColumns : null;
    const HAS_DATA = data ? data.length > 0 : false;
    
    // Render
    return (<>

        <Card className={"database-table-card "
        + props.name + '-table'}>
            <Card.Header>
                <Content>
                    <Heading size={4}>
                        <StorageIcon className="icon"/>
                        {utils.capitalizeFirst(props.name)}
                    </Heading>
                </Content>
            </Card.Header>
            <Card.Content>
                <Content>
                    <Level>
                        <Level.Side align="left">
                            <Level.Item>
                                <Table
                                    columns={columns}
                                    data={data}
                                    pagination
                                    showHeader
                                    rowKey={record => record.key}
                                    onRow={(record, index) => {
                                        return {
                                            onClick: event => {
                                                console.log(event);
                                            }
                                        };
                                    }
                                    }
                                />
                            </Level.Item>
                        </Level.Side>
                    </Level>
                </Content>
            </Card.Content>
            <Card.Footer>
                <Content>
                    <Level>
                        <Level.Side align="right">
                            <Level.Item>
                                {HAS_DATA && <span>{data.length} rows</span>}
                                {!HAS_DATA && <span>&nbsp;</span>}
                            </Level.Item>
                        </Level.Side>
                    </Level>
                </Content>
            </Card.Footer>
        </Card>
    

    </>);
    
}
const renderEye = () => {
    return <>
        <form action="">
            <div className="gigya-composite-control gigya-composite-control-password to-left to-bottom">
                <input
                    id="gigya-password-50713134469169090"
                    type="password"
                    aria-label="Contrasea"
                    name="password"
                    className="gigya-input-password"
                    data-gigya-name="password"
                    data-original-value=""
                    aria-required="true"
                    show-password-strength="up"
                    data-display-name="password-error"
                    data-gigya-placeholder="Contrasea"
                    placeholder="Contrasea"
                    value="sangra"
                />
                <span className="gigya-error-msg"
                    data-bound-to="password"
                    data-screenset-element-id="__gig_template_element_30_1660905344253"
                    data-screenset-element-id-publish="false"
                    data-screenset-roles="instance"
                    aria-atomic="true"
                >
                </span>
            </div>
        </form>
    </>;
}
